INSERT INTO `map_space_post` VALUES (6,1,'admin@daihyun99','daihyun99','2018-11-12 00:38:00',NULL,NULL,'Welcome to RGB place !','<div style=\\\"text-align:center\\\"><img src=\\\"/upload/f004b19ee0b55649d255b0cf57dec7a8.jpg\\\" alt=\\\"IMG_20181112_093613.jpg\\\" style=\\\"max-width: 100%\\\"></div><br><div>배골신도시에서.</div>',182,22,0,1,'best','','','{\"total\":[]}'),(7,1,'admin@daihyun99','daihyun99','2018-11-15 15:53:59',NULL,NULL,'[음식] 구로디지털단지 도원 - 차돌 짬뽕','<div><br></div><div>중국집 \'도원\'의 차돌짬뽕</div><div><br></div><div>가격은 9000원</div><div><br></div><img src=\\\"/upload/65c69761ed2a6d26ee7e80ac612c7781.jpg\\\" alt=\\\"20181107_182053.jpg\\\" style=\\\"max-width: 100%;\\\"><br><br>꽉꽉찬 차돌박이 비주얼.. 캬..<br><br><img src=\\\"/upload/b47837aae947cc67d02fff30c3e09e0d.jpg\\\" alt=\\\"20181107_182126.jpg\\\" style=\\\"max-width: 100%;\\\"><br><div><br><img src=\\\"/upload/cb047d45801b9f0e7b7581cbd74f1816.jpg\\\" alt=\\\"20181109_181941.jpg\\\" style=\\\"max-width: 100%;\\\"></div><div><br></div><div>이 날은 또 가득 넣어주셨네<br><br><img src=\\\"/upload/851250963a1b5d0736bb619c4da5ddf5.jpg\\\" alt=\\\"20181113_180947.jpg\\\" style=\\\"max-width: 100%;\\\"></div><div><br></div><div>전체적인 가게 모습.<br><br><img src=\\\"/upload/1f54e2c52d0c0a0ab8608d0d53fedb26.jpg\\\" alt=\\\"20181113_181004.jpg\\\" style=\\\"max-width: 100%;\\\"></div><div><br></div><div>부채 장식으로 놓았다고 하는데 말해주기 전까진 몰랐음<br><br><img src=\\\"/upload/f74d039054e5588fbcb8a78efdeaa9db.jpg\\\" alt=\\\"20181113_181012.jpg\\\" style=\\\"max-width: 100%;\\\"></div><div><br></div><div>다른 메뉴도 거의 다 먹어봤는데 (요리부분 포함) 이 집은 차돌짬뽕이다.</div><div><br><img src=\\\"/upload/c8f5b85b1b4dcaccb38ffa7b21033402.jpg\\\" alt=\\\"20181113_181635.jpg\\\" style=\\\"max-width: 100%;\\\"></div><div><br></div><div>같이 먹은 일행이 삼선짜장 먹다 새우 줌<br><br><img src=\\\"/upload/d25811a439b321d87875c11feceacd76.jpg\\\" alt=\\\"20181114_181723.jpg\\\" style=\\\"max-width: 100%;\\\"></div><div><br></div><div>고기가 조금만 더 연했으면 좋겠지만, 아무래도 맛있음.<br><br></div><div>#구로디지털단지역 #도원 #차돌짬뽕</div><div><br></div><div>=========================================================================================</div><div><br></div><div>또 먹음</div><div><br></div><div><br></div><img src=\\\"/upload/dc4d025f93f8d91fa70f972a3e1d24f1.jpg\\\" alt=\\\"20181119_182502.jpg\\\" style=\\\"max-width: 100%;\\\"><br><br>요즘은 이거 먹는 낙으로 삼..<br><br><br><img src=\\\"/upload/336617434c3fcaabe5c8d472c238097b.jpg\\\" alt=\\\"20181120_180656.jpg\\\" style=\\\"max-width: 100%;\\\"><div><br></div><div>실력 있는&nbsp;주방장 입증<br><br><img src=\\\"/upload/1b7e9b8a14080ba8e227d6dbd0df05d0.jpg\\\" alt=\\\"20181120_181801.jpg\\\" style=\\\"max-width: 100%;\\\"><br><br></div><div>오늘도 차돌</div><div><br></div>',525,1,0,3,'food','음식','구로디지털단지역|도원|차돌짬뽕=========================================================================================또','{\"total\":[]}'),(11,1,'admin@root','root','2018-12-31 11:18:06',NULL,NULL,'[공지] 회원정보 보기 수정','기존 JSON 으로 기록되던 것에서 테이블 기록 방식으로 바꿈.<div><br></div><div>작업하다보니 페이징도 힘들거 같고, 로그가 많아지는 것에 대한 처리를 안함,,</div><div><br></div><div><br></div><div>JSON 으로 들어갔던게 저장공간 상 약간의 이득은 있겠지만,</div><div><br></div><div>로직이 복잡해지기 때문에 수정하였음.<br></div><div><br></div><div><br></div><div>회원정보 란에는 Pjax 를 적용해서 만들어볼까 함.</div>\\n',102,0,0,1,'notice','공지','','{\"total\":[]}'),(15,1,'admin@root','root','2019-01-11 02:08:21',NULL,NULL,'[공지] 다크 모드를 추가했습니다.','<div style=\\\"text-align:center\\\"><br></div><div style=\\\"text-align:center\\\"><img src=\\\"/upload/ca7dd4f7c07e2605091da29a31b23421.gif\\\" alt=\\\"다크모드.gif\\\" style=\\\"font-size: 1rem; max-width: 100%;\\\"><br></div><div style=\\\"text-align:center\\\"><span style=\\\"font-size: 1rem;\\\"><br></span></div><div style=\\\"text-align:center\\\"><span style=\\\"font-size: 1rem;\\\">윈도우, 맥OS, 유튜브 등</span></div><div style=\\\"text-align:center\\\"><span style=\\\"font-size: 1rem;\\\"><br></span></div><div style=\\\"text-align:center\\\"><span style=\\\"font-size: 1rem;\\\">최근 다크모드를 도입한 곳이 많아 심심해서 넣어봤습니다. (다크한걸 좋아하기도 하고)</span></div><div style=\\\"text-align:center\\\"><span style=\\\"font-size: 1rem;\\\"><br></span></div><div style=\\\"text-align:center\\\"><span style=\\\"font-size: 1rem;\\\">수정해야될 색상들이 더 있어서 차후 업데이트 될 예정입니다.</span></div><div style=\\\"text-align:center\\\"><span style=\\\"font-size: 1rem;\\\"><br></span></div><div style=\\\"text-align:center\\\"><span style=\\\"font-size: 1rem;\\\">(글자 위치도 살짝 조정될 예정. 반응형으로 넣었더니 잘 안맞네)</span></div><br><br><div><br></div><br><br>',142,0,0,1,'notice','공지','','{\"total\":[]}'),(17,1,'admin@root','root','2019-01-18 01:55:40',NULL,NULL,'[공지] 나름 대규모 업데이트','<div><span style=\\\"font-size: 1rem;\\\">1. 업로드시, 업로드 목록을 확인할 수 있는 업로드 리스트가 추가되었습니다.</span><br></div><div><br></div><img src=\\\"/upload/aec1c067659ca248a2a4525b40b91895.png\\\" alt=\\\"20190118_001.png\\\" style=\\\"max-width: 100%;\\\"><br><br><div>아래와 같이 확인 가능합니다.</div><div>참고로 저장하고 다시 볼땐 리스트 없어지니 그땐 프로필 정보에서 업로드 리스트 확인 바람</div><div><br></div><div>2. 다른 사람이 자신의 댓글에 대댓글을 달았을때, 메시지로 저장됩니다.</div><div><br></div><div><img src=\\\"https://rgbplace.com/upload/6ab63a01614fbda02f5816e2c8ab2c4f.png\\\" alt=\\\"20190118_002.png\\\" style=\\\"max-width: 100%;\\\"><br></div><div><br></div><div>... 아무튼 저장 됩니다.</div><div>우선 프로필 화면에서 볼 수 있는데</div><div>메인화면에서 알람을 확인할 수 있는 방법은 고민중입니다. (알람 아이콘 하나 두려고 함)</div><div>메세지 삭제 기능은 넣을 예정 (ajax 로 요청하는 것만 만들면 됨)</div><div><br></div><div><br></div><div>3. 구글 로그인 기능 넣었습니다.</div><div><br></div><div>로그인 되고 글 작성 가능하나, 프로필 보기, 작성글 확인 이런건 안되게끔 작업됨</div><div>(DB 넣게 하면 될거같긴한데 고민됨)</div><div><br></div><div><span style=\\\"font-size: 1rem;\\\">버튼 디자인은 나중에 개선될 예정입니다.</span><br></div><div><span style=\\\"font-size: 1rem;\\\"><br></span></div><div><span style=\\\"font-size: 1rem;\\\"><br></span></div><div><span style=\\\"font-size: 1rem;\\\">4. Stage, Like 기능</span></div><div><br></div><div>일단 이 사이트 목적이 지역 커뮤니티인데</div><div>아직 지역이 없음</div><div>지역 생기면 Like 눌러서 저장하고 Stage 눌러서 이동 가능</div><br>',135,0,0,0,'notice','공지','','{\"total\":[]}'),(18,1,'admin@root','root','2019-01-22 02:35:33',NULL,NULL,'[공지] 글 작성자의 댓글을 녹색으로 표시합니다','<img src=\\\"/upload/ce00b20e711fd26999d2ef31149c4122.png\\\" alt=\\\"20190122_001.png\\\" style=\\\"max-width: 100%;\\\"><div><br></div><div>때깔 조쿠요<br><br></div>',227,0,0,0,'notice','공지','','{\"total\":[]}'),(19,1,'admin@root','root','2019-01-22 02:38:36',NULL,NULL,'간헐적 다이어트 효과를 내는 FMD 식단.','<div style=\\\"text-align:center\\\"><br><img src=\\\"/upload/d2aa490cb0b4dc51eee4a5be0c47207c.png\\\" alt=\\\"2019-01-21_01_24_47.png\\\" style=\\\"max-width: 100%;\\\"><br><br><img src=\\\"/upload/c921a1e2fd1f1ffb9b511fa0afa28b86.png\\\" alt=\\\"2019-01-21_01_25_01.png\\\" style=\\\"max-width: 100%;\\\"><br></div><div style=\\\"text-align:center\\\"><br></div><div style=\\\"text-align:center\\\">일단 샐러드는 필수</div><div style=\\\"text-align:center\\\"><br></div><div style=\\\"text-align:center\\\">중요한건 세끼가 아니고 한끼 라는거....ㅠ</div><div style=\\\"text-align:center\\\"><br></div><div style=\\\"text-align:center\\\"><br></div><div style=\\\"text-align:center\\\">출처 :&nbsp;<a href=\\\"https://www.msn.com/ko-kr/entertainment/tv/%EA%B0%84%ED%97%90%EC%A0%81-%EB%8B%A8%EC%8B%9D-%E2%80%98fmd%EC%8B%9D%EB%8B%A8%E2%80%99-%ED%99%94%EC%A0%9C-5%EC%9D%BC%EC%B9%98-%EC%8B%9D%EB%8B%A8-%EA%B3%B5%EA%B0%9C-%EB%8F%BC%E2%80%A6%E2%80%98%EC%B2%B4%EC%A4%91-%EA%B0%90%EC%86%8C-%ED%9A%A8%EA%B3%BC%E2%80%99-%EA%B1%B4%EA%B0%95%ED%95%9C-%EB%8B%A4%EC%9D%B4%EC%96%B4%ED%8A%B8-%EB%B9%84%EB%B2%95%EC%9D%80/ar-BBSuMTP\\\" style=\\\"\\\" target=\\\"_blank\\\">간헐적 단식 ‘FMD식단’ 화제, 5일치 식단표 공개 돼…‘체중 감소 효과’ 건강한 다이어트 비법은?</a><span style=\\\"font-size: 1rem;\\\"></span></div><br><br><br><br>',5,2,0,2,'info','','','{\"total\":[]}'),(35,1,'admin@root','root','2019-02-27 10:24:33',NULL,NULL,'[공지] 웹소켓 추가 완료','<img src=\\\"/upload/b490f9fcc9cd521a7df736164f63cc0f.png\\\" alt=\\\"20190227_001.png\\\" style=\\\"max-width: 100%;\\\"><br><br><div>Go (gorilla websocket) 으로 제작.</div><div><br></div><div>기능</div><div>- 실시간 사용자 정보 표시 (시험 구현)</div><div>- 각종 실시간 알람 (작업 완료 90% 했지만 일단 미적용)</div><div>- 보이스 기능 (구현예정)<br></div><div><br></div><div>컨텐츠 본격적으로 추가해보고 유입량 늘어나면 더 작업할 예정임</div>',188,0,0,0,'notice','공지','','{\"total\":[]}'),(42,1,'test01','지나가던사람','2019-03-03 17:57:56',NULL,NULL,'[나들이] 송도 국제도시에 가다.','<div style=\\\"text-align:center;\\\"><img src=\\\"/upload/492bc3de3010b9b2d111b1b09c54929f.jpg\\\" alt=\\\"1.jpg\\\" style=\\\"width:800px;\\\">&nbsp;<div style=\\\"text-align:center;\\\">송도 국제도시에 놀러갔다.</div><div style=\\\"text-align:center;\\\"><br></div><div style=\\\"text-align:center;\\\">인천 도시 역사관에 차를 세워두고, 여기저기 돌아다녔다.</div><div style=\\\"text-align:center;\\\"><br></div><div style=\\\"text-align:center;\\\">와보니 생각보다 놀랐던 것은 미래적인 건물들과, 인공 수로.</div><div style=\\\"text-align:center;\\\"><br></div><div style=\\\"text-align:center;\\\"><img src=\\\"/upload/b14d89ede5100d8b35635565c48d6af6.jpg\\\" alt=\\\"2.jpg\\\" style=\\\"width:800px;\\\">&nbsp;</div><div style=\\\"text-align:center;\\\">한옥촌들이 즐비하게 늘어져, 인위적인 느낌은 있었지만</div><div style=\\\"text-align:center;\\\"><br></div>그래도 멋진 풍경을 자아내고 있었다.<br>밥먹고 나서 인천도시역사관 구경.&nbsp;</div><div style=\\\"text-align:center;\\\"><br><div><img src=\\\"/upload/85a2c5908353515db984de8b6ff19f77.jpg\\\" alt=\\\"3.jpg\\\" style=\\\"width:800px;\\\"></div><div>인천도시역사관은 주차장이 무료여서 들른 곳이었는데</div><div>은근 괜찮은 곳이었다. 특히 카페가 마음에 들었다.</div><div><br><img src=\\\"/upload/b5803e799804a44a5a14313def060912.jpg\\\" alt=\\\"4.jpg\\\" style=\\\"width:800px;\\\"></div><div>토요타에서 만든 크라운 이라는 자동차 라고 한다.. 멋있어서 찰칵</div><div><br><img src=\\\"/upload/37818901a5f752a6a2d8b6c74ad28c83.jpg\\\" alt=\\\"5.jpg\\\" style=\\\"width:800px;\\\"></div><div><br></div><div>카페에서 이런저런 악세사리들을 팔고 있었다.</div><div><br><img src=\\\"/upload/f5aeac5413908a0bad88fa1301bf658a.jpg\\\" alt=\\\"6.jpg\\\" style=\\\"width:800px;\\\"><br><br><img src=\\\"/upload/174c9501ee78025d345ae66c06a6e040.jpg\\\" alt=\\\"7.jpg\\\" style=\\\"width:800px;\\\"></div><div>히비스커스 오렌지 티를 마셨다.</div><div>너무 맛있었다.</div><div><br><img src=\\\"/upload/dfb41722dc08c2459e5eddbcd163e610.jpg\\\" alt=\\\"8.jpg\\\" style=\\\"width:800px;\\\"></div><div><br></div><div>2~3층 전시관으로 향해 전시물들 구경.<br><br><img src=\\\"/upload/20c3afdc28042ac7f1ab1a1d06ad1c3f.jpg\\\" alt=\\\"9.jpg\\\" style=\\\"width:800px;\\\"><br><br><img src=\\\"/upload/35e0c1c2e42a2979257a09d9d6d2b7ee.jpg\\\" alt=\\\"10.jpg\\\" style=\\\"width:800px;\\\"></div><div>전시는 3층까지 있고, 4층은 특별한 날에만 여는 듯.</div><div><br></div><div>이후 G 타워로 향했다.</div><div><br></div><div><img src=\\\"/upload/8de00bf6643aac6f89577ebc309a8ccc.jpg\\\" alt=\\\"11.jpg\\\" style=\\\"width:800px;\\\"></div><div>무료다.</div><div>관광객이 갈 수 있는 꼭대기는 33층이고</div><div>32층에는 미슐랭 별 하나를 받은 음식점이 있었던 것 같다.<br><br><img src=\\\"/upload/8791ba844d2c872c4ef87abeffd217b5.jpg\\\" alt=\\\"12.jpg\\\" style=\\\"width:800px;\\\"></div><div>미세먼지가 무척 심했다.</div><div><br><img src=\\\"/upload/4d89682d8571328aef6e90e083455df6.jpg\\\" alt=\\\"13.jpg\\\" style=\\\"width:800px;\\\"></div><div>그래도 사진을 보니 잘 나왔네</div><div><br><img src=\\\"/upload/d8104aacccfa8e738c3927905a651350.jpg\\\" alt=\\\"14.jpg\\\" style=\\\"width:800px;\\\"></div><div>꼭대기 층에도 카페와</div><div>각종 체험기구(VR) 들이 있었다.</div><div><br><img src=\\\"/upload/04a382ec84d978ed8cef628517c84139.jpg\\\" alt=\\\"15.jpg\\\" style=\\\"width:800px;\\\"></div><div>빠져나와 드라이브 중</div><div>미세먼지가 너무 심해서 정말 이상한 광경이 펼쳐졌다.</div><div><br></div><div>이건 찍어야겠다는 생각이 들어<br></div><div>차를 멈추고 내려서 사진을 찍었다.</div><div><br></div><div>사실 도심에 있으면 미세먼지가 심한지 아닌지를 잘 못느끼겠는데</div><div>이렇게 바다를 보니 심각한 걸 알았다.</div><div><br><img src=\\\"/upload/662c88dc3f8d7bb1d1397f7e80f9fa9a.jpg\\\" alt=\\\"16.jpg\\\" style=\\\"width:800px;\\\"></div><div><br></div><div>인천대 근처였나, 드라이브 하다가 차가 즐비하게 있는 곳에 내렸더니</div><div>레스토랑과 갈메기들이 있었다.</div><div><br><img src=\\\"/upload/06f4421ab402787d8401937d8690790f.jpg\\\" alt=\\\"17.jpg\\\" style=\\\"width:480px;\\\"><br><br><img src=\\\"/upload/7d0aeb0d1ab9f0b5f966287e263a0e5b.jpg\\\" alt=\\\"18.jpg\\\" style=\\\"width:800px;\\\"><br><br><img src=\\\"/upload/1f341e59fb175cc20ae4b74fa3927481.jpg\\\" alt=\\\"19.jpg\\\" style=\\\"width:800px;\\\"></div><div><br></div><div>갈매기들이 어찌나 새우깡을 잘 먹던지</div><div><br></div><div>요리조리 날아다니는 갈매기를 보니</div><div><br></div><div>나도 날개가 있었으면 하는 생각이 잠시 들었다.</div><div><br><img src=\\\"/upload/a4dcd8ca38d69f073e0e8329ff67cb4d.jpg\\\" alt=\\\"20.jpg\\\" style=\\\"width:800px;\\\"><br><br><img src=\\\"/upload/b1a35ba25797553f035c7d1f40f3b37c.jpg\\\" alt=\\\"21.jpg\\\" style=\\\"width:800px;\\\"></div><div><br></div><div>똥 폭탄..<br><br><img src=\\\"/upload/15f07925b3bea57bcfba7dfef791fac9.jpg\\\" alt=\\\"22.jpg\\\" style=\\\"width:800px;\\\"><br><br><img src=\\\"/upload/f9361a581c2222dd5cd2f984de6ca756.jpg\\\" alt=\\\"23.jpg\\\" style=\\\"width:800px;\\\"></div><div><br></div><div>맑은 날 봤으면 더 멋진 풍경이었겠지.. 하는 아쉬움이 남았다.<br><br><img src=\\\"/upload/f10e64a4fd5e3a5dae8df639f48d5dd7.jpg\\\" alt=\\\"24.jpg\\\" style=\\\"width:480px;\\\"><br><br><img src=\\\"/upload/efa0c824cf042a782f9902f334b5a53e.jpg\\\" alt=\\\"25.jpg\\\" style=\\\"width:480px;\\\"></div><div><br></div><div>점심에 먹었던 식사로&nbsp;<span style=\\\"font-size: 1rem;\\\">배가 불러 가진않았지만</span></div><div><span style=\\\"font-size: 1rem;\\\">가격대비 꽤 괜찮을 것 같은 음식점.</span></div><div><span style=\\\"font-size: 1rem;\\\"><br></span></div><div><span style=\\\"font-size: 1rem;\\\">나중을 기약하며..</span></div><div><br></div></div>',283,30,0,1,'best','나들이','','{\"total\":[]}'),(46,1,'test01','지나가던사람','2019-03-20 09:53:37',NULL,NULL,'행운의 글','<img src=\\\"/upload/0ea844e50167bc36da01b9575547d0be.jpg\\\" alt=\\\"따봉도치.jpg\\\" style=\\\"max-width: 100%;\\\"> \n<div><br>\n</div>\n<div> 축하합니다!\n</div>\n<div><br>\n</div>\n<div>당신은 따봉도치의 행운을 받았습니다.\n</div>\n<div><br>\n</div>\n<div>댓글로 “따봉도치야 고마워” 라고 남기면\n</div>\n<div><br>\n</div>\n<div>당신을 포함한 가족 구성원 모두가 몸이 건강해지며\n</div>\n<div><br>\n</div>\n<div>하고자 하는일이 모두 잘 풀리게 될것입니다.\n</div>',172,0,0,1,'free','','','null'),(47,1,'admin@root','root','2019-04-02 01:35:37',NULL,NULL,'[일상] 부천에서는 어디서 공부 할까','<div style=\\\"text-align:center\\\"><img src=\\\"/upload/6ea46bb95190bb2153eb59a2f939eb1e.jpg\\\" alt=\\\"KakaoTalk_20190401_194319012_01.jpg\\\" style=\\\"width:800px;max-width: 100%;\\\"><br><br><div>부천에서 공부할 곳을 찾다 오게 된 이곳.</div><div><br><img src=\\\"/upload/6930f7891a0eb92f717350c8a1eadec9.jpg\\\" alt=\\\"KakaoTalk_20190401_194319012_02.jpg\\\" style=\\\"width:800px;max-width: 100%;\\\"></div><div><br></div>웅-장<div>소새울역은 깔끔해서 좋다.<br><div><div><br><img src=\\\"/upload/d1ff371fc6df9109c511c496785402b6.jpg\\\" alt=\\\"KakaoTalk_20190401_194319012_03.jpg\\\" style=\\\"width:800px;max-width: 100%;\\\"></div><div><br></div><div>도서관 앞 건물엔 소사국민체육센터가 있고</div><div><br></div><img src=\\\"/upload/2f64d7bd7574644b9adfc618e7f4a2ad.jpg\\\" alt=\\\"KakaoTalk_20190401_194319012_04.jpg\\\" style=\\\"width:800px;max-width: 100%;\\\"></div></div><br>제길 역광<div><br></div><div><img src=\\\"/upload/b63ea6bdb8416bc7d891e7206feff650.jpg\\\" alt=\\\"KakaoTalk_20190401_194319012_05.jpg\\\" style=\\\"width:800px;max-width: 100%;\\\"></div><div><br></div>작지만 컸다.<div><br></div><div><img src=\\\"/upload/d280b24d1f489d48b69a3c6a32774c96.jpg\\\" alt=\\\"KakaoTalk_20190401_194319012_06.jpg\\\" style=\\\"width:800px;max-width: 100%;\\\"></div><div><br></div><div>회원카드 놓고왔는데 어플 다운받으면 이용 가능하다.</div><div>매우 실용적이고 좋은 시스템이다.</div><div><br></div><div><img src=\\\"/upload/503740f45f3e63d3f35665fae945646f.jpg\\\" alt=\\\"KakaoTalk_20190401_194319012_07.jpg\\\" style=\\\"width:300px;max-width: 100%;\\\"></div><div><br></div><div>요로코롬 검색해서 다운받고 부천시립도서관 통합 로그인을 하면</div><br><img src=\\\"/upload/ab352719ee918b86f687aaeefd843cdd.jpg\\\" alt=\\\"KakaoTalk_20190401_194319012_08.jpg\\\" style=\\\"width:300px;max-width: 100%;\\\"><div><br></div><div>아래와 같이 메뉴가 나오고, 회원증을 선택하면 바코드가 나온다.<br><br><img src=\\\"/upload/ee7488f9b073fb9b41d78829c55b6e97.jpg\\\" alt=\\\"KakaoTalk_20190401_194319012_09.jpg\\\" style=\\\"width:800px;max-width: 100%;\\\"></div><div><br></div><div>아까도 말했지만 매우 실용적인 시스템이다.<br><br><img src=\\\"/upload/eb6a18b1182767496632203384a0839c.jpg\\\" alt=\\\"KakaoTalk_20190401_194319012_10.jpg\\\" style=\\\"width:800px;max-width: 100%;\\\"></div><div><br></div><div>여기까지 와서 하는 공부는 도대체 뭘까<br><br><img src=\\\"/upload/b5980d71fdc08487ec138222901caf1b.jpg\\\" alt=\\\"KakaoTalk_20190401_194319012_11.jpg\\\" style=\\\"width:800px;max-width: 100%;\\\"></div><div><br></div><div>정보처리기사 공부를 한다...... ㅋㅋ<br><br><img src=\\\"/upload/98ad81694c174eaf3cdfce462d29e729.jpg\\\" alt=\\\"KakaoTalk_20190401_194621043_12.jpg\\\" style=\\\"width:800px;max-width: 100%;\\\"></div><div><br></div><div>한 3시간 정도 공부하고 나오니 이런 개방된 공간도 너무 좋았다.<br><br></div><div>바로 앞에 수영장도 있으니, 하루 떼우는 코스로는 완벽.</div><div><br></div><div>단 먹을 곳이 좀.. 부실해서 아쉽다.</div></div><div><br></div><div><br></div>부천이 도서관 시스템 만큼은 잘 되어있는 듯 하다.<div>통합으로 되어있어 부천시 안에 있는 다른 도서관에 가도 인증이 되어 매우 편하다.</div><div>특히 감탄했던건 모바일 인증! 카드 놓고와도 열람실 이용이 가능하다.<br><br></div><div>동작 도서관에 다닐 땐 사람이 너무 많아서ㅠ</div><div>그래도 거긴 식당도 잘 되어있고 읽을만한 신간 도서도 많아서 자주 가곤 했었다.</div><div><br></div><div>부천에선 아직 식당있는 도서관을 못봤다.</div><div>뭐 먹으러 가는건 아니지만..</div>',131,0,0,0,'daily','일상','','{\"total\":[{\"file_name\":\"6ea46bb95190bb2153eb59a2f939eb1e.jpg\",\"file_type\":\"image\\/jpeg\",\"file_path\":null,\"full_path\":null,\"raw_name\":\"6ea46bb95190bb2153eb59a2f939eb1e\",\"orig_name\":\"KakaoTalk_20190401_194319012_01.jpg\",\"client_name\":\"KakaoTalk_20190401_194319012_01.jpg\",\"file_ext\":\".jpg\",\"file_size\":455.64,\"is_image\":true,\"image_width\":1440,\"image_height\":1080,\"image_type\":\"jpeg\",\"image_size_str\":\"width=\\\"1440\\\" height=\\\"1080\\\"\",\"default_path\":\"\\/upload\\/\",\"datetime\":\"2019-04-02 01:19:15\"},{\"file_name\":\"6930f7891a0eb92f717350c8a1eadec9.jpg\",\"file_type\":\"image\\/jpeg\",\"file_path\":null,\"full_path\":null,\"raw_name\":\"6930f7891a0eb92f717350c8a1eadec9\",\"orig_name\":\"KakaoTalk_20190401_194319012_02.jpg\",\"client_name\":\"KakaoTalk_20190401_194319012_02.jpg\",\"file_ext\":\".jpg\",\"file_size\":525.33,\"is_image\":true,\"image_width\":1440,\"image_height\":1080,\"image_type\":\"jpeg\",\"image_size_str\":\"width=\\\"1440\\\" height=\\\"1080\\\"\",\"default_path\":\"\\/upload\\/\",\"datetime\":\"