67496632203384a0839c\",\"orig_name\":\"KakaoTalk_20190401_194319012_10.jpg\",\"client_name\":\"KakaoTalk_20190401_194319012_10.jpg\",\"file_ext\":\".jpg\",\"file_size\":480.29,\"is_image\":true,\"image_width\":1440,\"image_height\":1080,\"image_type\":\"jpeg\",\"image_size_str\":\"width=\\\"1440\\\" height=\\\"1080\\\"\",\"default_path\":\"\\/upload\\/\",\"datetime\":\"2019-04-02 01:20:41\"},{\"file_name\":\"b5980d71fdc08487ec138222901caf1b.jpg\",\"file_type\":\"image\\/jpeg\",\"file_path\":null,\"full_path\":null,\"raw_name\":\"b5980d71fdc08487ec138222901caf1b\",\"orig_name\":\"KakaoTalk_20190401_194319012_11.jpg\",\"client_name\":\"KakaoTalk_20190401_194319012_11.jpg\",\"file_ext\":\".jpg\",\"file_size\":404.36,\"is_image\":true,\"image_width\":1440,\"image_height\":1080,\"image_type\":\"jpeg\",\"image_size_str\":\"width=\\\"1440\\\" height=\\\"1080\\\"\",\"default_path\":\"\\/upload\\/\",\"datetime\":\"2019-04-02 01:20:41\"},{\"file_name\":\"98ad81694c174eaf3cdfce462d29e729.jpg\",\"file_type\":\"image\\/jpeg\",\"file_path\":null,\"full_path\":null,\"raw_name\":\"98ad81694c174eaf3cdfce462d29e729\",\"orig_name\":\"KakaoTalk_20190401_194621043_12.jpg\",\"client_name\":\"KakaoTalk_20190401_194621043_12.jpg\",\"file_ext\":\".jpg\",\"file_size\":551.2,\"is_image\":true,\"image_width\":1440,\"image_height\":1080,\"image_type\":\"jpeg\",\"image_size_str\":\"width=\\\"1440\\\" height=\\\"1080\\\"\",\"default_path\":\"\\/upload\\/\",\"datetime\":\"2019-04-02 01:20:41\"}]}'),(48,1,'admin@root','root','2019-04-02 15:35:55',NULL,NULL,'[예정] 에디터 변경 작업','1. 업로드 부분은 그나마 개선을 해서 불편사항이 아직은 조금 남아있지만, 이 정도면 의도한 대로 동작하고 있음\n\n2. 문제는 에디터임. 그냥 대충 쓰려다보니 너무 불편함. 특히 이미지 있는 글 작성할때 이미지가 너무 커서 글 수정할때 스크롤 왔다갔다하는게 넘 힘듬\n\n3. 과거엔 간단하게 글 쓰고 태그로 디테일하게 수정하면 될 줄 알았는데 막상 써보니 그게 아님. 태그는 또 태그 나름대로 불편하고 생각보다 건드려야될게 좀 있었음.\n\n4. 에디터 만드는건 또 매우 귀찮음\n\n5. 예전에 SimpleMDE 쓰려다 말았는데 지금 다시 보니 원하는 기능을 80% 충족시켜 이번에 적용할 예정임\n\n6. 개발기간은 짧을 것으로 예상.\n\n7. 에디터의 중요함을 깨달음. 이후 포스트 쪽도 CSS 건드려볼 예정. (폰트는 모바일에서는 괜찮은데 PC 에선 좀 읽기 힘든 것 같아 수정)\n\n8. 로그인 폼도 수정해야됨 특히 버튼\n\n---\n\n2019-07-05\n\nCodeMirror + PHP Parsedown 라이브러리 사용하여 완성.',212,0,0,0,'notice','예정','',NULL),(50,1,'admin@root','root','2019-04-11 23:41:21',NULL,NULL,'[공지] 최근 변경 사항 및 앞으로 업데이트 예정 사항','## 오늘 업데이트 내용 (2019.04.11)\n\n1. 상대방의 정보를 볼 수 있는 Profile 페이지 개선이 이루어졌습니다.\n로그인 한 상태에서만 보이며, 개인정보(ID) 가 나오지 않게 수정했습니다.\n\n2. Profile 페이지에 cancel 버튼을 없애고, reset 버튼을 추가했습니다.\n또, 메일 변경에 대한 처리 안내를 좀 더 직관적이게 바꿨습니다.\n\n3. 추천/반대 기능의 버그를 수정했습니다.\n추천 30이 넘으면 BEST 로 넘어가고, FREE 타입은 BEST 로 넘어가지 않습니다.\n\n---\n\n## 앞으로의 업데이트\n\n1. ~~마크다운 에디터 적용~~ (2019.04.21 v1.0 완료!)\n\n => 적용 완료 했는데 복사붙여넣기 버그 있어서 결국 EasyMDE 로 변경\n \n => EasyMDE 에선 모바일에서 글 지울때 버그가 있어  또 다시 롤백 후 CodeMirror 적용할 예정.. ㅠㅠ\n \n (EasyMDE 는 커스터마이징이 되는데 그렇게되면 공식 업데이트 안되고, 커스터마이징 환경 셋팅해야되고 등등 불편사항이 또 있어서...)\n \n => 이후 CodeMirror 적용 (커스터마이징 에디터 필수템으로 등극). Marked.js 적용. 더불어, 스크롤 동기화 기능도 넣었다. 어느정도 에디터 틀은 만든 셈. 이후 색깔이나 태그를 쉽게 넣을 수 있게 메뉴를 나중에 추가할 예정이다. => 스크롤 동기화 기능 빼고, 커서 이동 시 뷰 화면도 이동하게 만듦. 이게 훨씬 보기 편하다.\n\n2. ~~타입별 공지사항~~ => 완료. admin 계정으로 \\\'#\\\' + notice 넣으면 된다.\n\n 2.1 ~~Sponsor => Event 로 변경하기~~\n\n3. ~~상단 로그인 박스 개선 및 네이버, 카카오 로그인 기능 추가 + 개인정보취급 방침 넣기~~ => 완료. 개인정보 취급 방침은 나중에 위치 수정\n\n4. ~~상단 댓글 알람 표시~~\n\n(2019/05/04 현재 여기까지 완료.)\n\n---\n\n이후 나중에 적용할 기능들\n\n5. 실시간 알람 : _**best**_ 게시글 이동\n\n6. 현재 생성된 맵을 볼 수 있는 페이지와, 맵별 사용 태그를 한 눈에 볼 수 있는 페이지 만들기\n\n (활동 현황 등의 페이지도 있으면 좋을 것 같다.)\n\n7. ~~댓글에 GIF 이미지를 넣을 수 있는 GIPHY API 적용~~\n\n	그냥 이미지 업로드 댓글을 넣자... 용량제한 + 크기 제한, 댓글 하나당 하나의 이미지만.\n\n---\n\n## 올해 목표\n\n1. **사이트의 완성도를 좀 더 높이고 컨텐츠를 쌓는다. 열심히 놀 예정.**\n\n2. ~~vueJS 학습과 about.rgbplace.com 페이지의 완성~~\n\n	학습(https://play.rgbplace.com) 및 페이지 완성 (https://about.rgbplace.com)\n\n3. **파이썬 학습**과 보안 & 테스팅 툴 (Locust) 익히기',138,0,0,0,'notice','공지','',NULL),(52,1,'admin@root','root','2019-04-16 20:56:40',NULL,NULL,'[필독] 많은 부분에서 테스트 중입니다.','#notice\n\n![고깔고깔.gif](/upload/ba74d52aa6e4627c35293a0f6ac59f1f.gif)\n\n불필요한 게시글 작성 시, 게시글이 삭제되거나 계정을 삭제할 수 있습니다.\n\n양해 부탁드립니다.',55,0,0,0,'free','필독','notice\\n\\n![고깔고깔.gif](/upload/ba74d52aa6e4627c35293a0f6ac59f1f.gif)\\n\\n불필요한','{\"total\":[{\"file_name\":\"ba74d52aa6e4627c35293a0f6ac59f1f.gif\",\"file_type\":\"image\\/gif\",\"file_path\":null,\"full_path\":null,\"raw_name\":\"ba74d52aa6e4627c35293a0f6ac59f1f\",\"orig_name\":\"\\u1100\\u1169\\u1101\\u1161\\u11af\\u1100\\u1169\\u1101\\u1161\\u11af.gif\",\"client_name\":\"\\u1100\\u1169\\u1101\\u1161\\u11af\\u1100\\u1169\\u1101\\u1161\\u11af.gif\",\"file_ext\":\".gif\",\"file_size\":2224.5,\"is_image\":true,\"image_width\":480,\"image_height\":344,\"image_type\":\"gif\",\"image_size_str\":\"width=\\\"480\\\" height=\\\"344\\\"\",\"default_path\":\"\\/upload\\/\",\"datetime\":\"2019-04-16 21:02:50\"}]}'),(54,1,'admin@root','root','2019-04-29 23:35:47',NULL,NULL,'개인정보 처리 방침','#notice #no_reply #no_vote\n\n1. 개인정보의 처리 목적 (\\\'https://rgbplace.com\\\' 이하 \\\'RGB place\\\') 은(는) 다음의 목적을 위하여 개인정보를 처리하고 있으며, 다음의 목적 이외의 용도로는 이용하지 않습니다.\n- 고객 가입의사 확인, 고객에 대한 서비스 제공에 따른 본인 식별.인증, 회원자격 유지.관리, 물품 또는 서비스 공급에 따른 금액 결제, 물품 또는 서비스의 공급.배송 등\n\n\n2. 개인정보의 처리 및 보유 기간\n\n ① (\\\'https://rgbplace.com\\\' 이하 \\\'RGB place\\\') 은(는) 정보주체로부터 개인정보를 수집할 때 동의 받은 개인정보 보유․이용기간 또는 법령에 따른 개인정보 보유․이용기간 내에서 개인정보를 처리․보유합니다.\n\n ② 구체적인 개인정보 처리 및 보유 기간은 다음과 같습니다.\n\n ☞ 아래 예시를 참고하여 개인정보 처리업무와 개인정보 처리업무에 대한 보유기간 및 관련 법령, 근거 등을 기재합니다.\n(예시)- 고객 가입 및 관리 : 서비스 이용계약 또는 회원가입 해지시까지, 다만 채권․채무관계 잔존시에는 해당 채권․채무관계 정산시까지\n- 전자상거래에서의 계약․청약철회, 대금결제, 재화 등 공급기록 : 5년\n\n3. 개인정보의 제3자 제공에 관한 사항\n\n ① (\\\'https://rgbplace.com\\\' 이하 \\\'RGB place\\\')은(는) 정보주체의 동의, 법률의 특별한 규정 등 개인정보 보호법 제17조 및 제18조에 해당하는 경우에만 개인정보를 제3자에게 제공합니다.\n\n\n4. 개인정보처리 위탁\n\n ① (\\\'RGB place\\\')은(는) 원활한 개인정보 업무처리를 위하여 다음과 같이 개인정보 처리업무를 위탁하고 있습니다.\n\n ② (\\\'https://rgbplace.com\\\' 이하 \\\'RGB place\\\')은(는) 위탁계약 체결시 개인정보 보호법 제25조에 따라 위탁업무 수행목적 외 개인정보 처리금지, 기술적․관리적 보호조치, 재위탁 제한, 수탁자에 대한 관리․감독, 손해배상 등 책임에 관한 사항을 계약서 등 문서에 명시하고, 수탁자가 개인정보를 안전하게 처리하는지를 감독하고 있습니다.\n\n ③ 위탁업무의 내용이나 수탁자가 변경될 경우에는 지체없이 본 개인정보 처리방침을 통하여 공개하도록 하겠습니다.\n\n5. 정보주체와 법정대리인의 권리·의무 및 그 행사방법 이용자는 개인정보주체로써 다음과 같은 권리를 행사할 수 있습니다.\n\n ① 정보주체는 RGB place(\\\'https://rgbplace.com\\\' 이하 \\\'RGB place) 에 대해 언제든지 다음 각 호의 개인정보 보호 관련 권리를 행사할 수 있습니다.\n  1. 개인정보 열람요구\n  2. 오류 등이 있을 경우 정정 요구\n  3. 삭제요구\n  4. 처리정지 요구\n\n6. 처리하는 개인정보의 항목 작성\n\n ① (\\\'https://rgbplace.com\\\' 이하 \\\'RGB place\\\')은(는) 다음의 개인정보 항목을 처리하고 있습니다.\n\n\n  - 필수항목 : 이메일, 비밀번호, 로그인ID, 서비스 이용 기록, 접속 로그, 쿠키, 접속 IP 정보\n  - 선택항목 : 이름\n\n7. 개인정보의 파기(\\\'RGB place\\\')은(는) 원칙적으로 개인정보 처리목적이 달성된 경우에는 지체없이 해당 개인정보를 파기합니다. 파기의 절차, 기한 및 방법은 다음과 같습니다.\n\n - 파기절차\n\n 이용자가 입력한 정보는 목적 달성 후 별도의 DB에 옮겨져(종이의 경우 별도의 서류) 내부 방침 및 기타 관련 법령에 따라 일정기간 저장된 후 혹은 즉시 파기됩니다. 이 때, DB로 옮겨진 개인정보는 법률에 의한 경우가 아니고서는 다른 목적으로 이용되지 않습니다.\n\n - 파기기한\n\n 이용자의 개인정보는 개인정보의 보유기간이 경과된 경우에는 보유기간의 종료일로부터 5일 이내에, 개인정보의 처리 목적 달성, 해당 서비스의 폐지, 사업의 종료 등 그 개인정보가 불필요하게 되었을 때에는 개인정보의 처리가 불필요한 것으로 인정되는 날로부터 5일 이내에 그 개인정보를 파기합니다.\n\n\n\n8. 개인정보 자동 수집 장치의 설치•운영 및 거부에 관한 사항\n\n ① RGB place 은 개별적인 맞춤서비스를 제공하기 위해 이용정보를 저장하고 수시로 불러오는 \\\'쿠키(cookie)\\\'를 사용합니다. ② 쿠키는 웹사이트를 운영하는데 이용되는 서버(http)가 이용자의 컴퓨터 브라우저에게 보내는 소량의 정보이며 이용자들의 PC 컴퓨터내의 하드디스크에 저장되기도 합니다. 가. 쿠키의 사용 목적 : 이용자가 방문한 각 서비스와 웹 사이트들에 대한 방문 및 이용형태, 인기 검색어, 보안접속 여부, 등을 파악하여 이용자에게 최적화된 정보 제공을 위해 사용됩니다. 나. 쿠키의 설치•운영 및 거부 : 웹브라우저 상단의 도구>인터넷 옵션>개인정보 메뉴의 옵션 설정을 통해 쿠키 저장을 거부 할 수 있습니다. 다. 쿠키 저장을 거부할 경우 맞춤형 서비스 이용에 어려움이 발생할 수 있습니다.\n\n\n9. 개인정보 보호책임자 작성\n\n ① RGB place(\\\'https://rgbplace.com\\\' 이하 \\\'RGB place) 은(는) 개인정보 처리에 관한 업무를 총괄해서 책임지고, 개인정보 처리와 관련한 정보주체의 불만처리 및 피해구제 등을 위하여 아래와 같이 개인정보 보호책임자를 지정하고 있습니다.\n\n ▶ 개인정보 보호책임자 <br/>\n 성명 : 임대현 <br/>\n 직책 : 대표자 <br/>\n 직급 : 대표 <br/>\n 연락처 : admin@rgbplace.com <br/>\n ※ 개인정보 보호 담당부서로 연결됩니다.\n\n ▶ 개인정보 보호 담당부서 <br/>\n 부서명 : X<br/>\n 담당자 : 임대현 <br/>\n 연락처 : admin@rgbplace.com  <br/>\n\n ② 정보주체께서는 RGB place(\\\'https://rgbplace.com\\\' 이하 \\\'RGB place) 의 서비스(또는 사업)을 이용하시면서 발생한 모든 개인정보 보호 관련 문의, 불만처리, 피해구제 등에 관한 사항을 개인정보 보호책임자 및 담당부서로 문의하실 수 있습니다. RGB place(\\\'https://rgbplace.com\\\' 이하 \\\'RGB place) 은(는) 정보주체의 문의에 대해 지체 없이 답변 및 처리해드릴 것입니다.\n\n\n\n10. 개인정보 처리방침 변경\n\n ① 이 개인정보처리방침은 시행일로부터 적용되며, 법령 및 방침에 따른 변경내용의 추가, 삭제 및 정정이 있는 경우에는 변경사항의 시행 7일 전부터 공지사항을 통하여 고지할 것입니다.\n\n\n\n11. 개인정보의 안전성 확보 조치 (\\\'RGB place\\\')은(는) 개인정보보호법 제29조에 따라 다음과 같이 안전성 확보에 필요한 기술적/관리적 및 물리적 조치를 하고 있습니다.\n\n 1. 정기적인 자체 감사 실시\n개인정보 취급 관련 안정성 확보를 위해 정기적(분기 1회)으로 자체 감사를 실시하고 있습니다.\n\n 2. 내부관리계획의 수립 및 시행\n개인정보의 안전한 처리를 위하여 내부관리계획을 수립하고 시행하고 있습니다.\n\n 3. 해킹 등에 대비한 기술적 대책\n(\\\'RGB place\\\')은 해킹이나 컴퓨터 바이러스 등에 의한 개인정보 유출 및 훼손을 막기 위하여 보안프로그램을 설치하고 주기적인 갱신·점검을 하며 외부로부터 접근이 통제된 구역에 시스템을 설치하고 기술적/물리적으로 감시 및 차단하고 있습니다.\n\n 4. 접속기록의 보관 및 위변조 방지\n개인정보처리시스템에 접속한 기록을 최소 6개월 이상 보관, 관리하고 있으며, 접속 기록이 위변조 및 도난, 분실되지 않도록 보안기능 사용하고 있습니다.\n\n 5. 개인정보에 대한 접근 제한\n개인정보를 처리하는 데이터베이스시스템에 대한 접근권한의 부여,변경,말소를 통하여 개인정보에 대한 접근통제를 위하여 필요한 조치를 하고 있으며 침입차단시스템을 이용하여 외부로부터의 무단 접근을 통제하고 있습니다.',51,0,0,0,'notice','','notice|no_reply|no_vote',NULL),(57,1,'admin@root','root','2019-05-09 12:03:00',NULL,NULL,'방통위, 블로그 및 인터넷 운영자들에게 움짤 포함 권고','![1557370777497.jpg](/upload/a183e5582b6cc93835caf61190e97258.jpg)\n\n![1557370780134.jpg](/upload/9c3e305ffdf157728f1bfda31e220a62.jpg)\nhttps://v.kakao.com/v/20190509104502122\n\ngif 포함 시 제목에 GIF 표기를 진행해볼 예정.',91,0,0,0,'news','','','{\"total\":[{\"file_name\":\"a183e5582b6cc93835caf61190e97258.jpg\",\"file_type\":\"image\\/jpeg\",\"file_path\":null,\"full_path\":null,\"raw_name\":\"a183e5582b6cc93835caf61190e97258\",\"orig_name\":\"1557370777497.jpg\",\"client_name\":\"1557370777497.jpg\",\"file_ext\":\".jpg\",\"file_size\":125.52,\"is_image\":true,\"image_width\":664,\"image_height\":960,\"image_type\":\"jpeg\",\"image_size_str\":\"width=\\\"664\\\" height=\\\"960\\\"\",\"default_path\":\"\\/upload\\/\",\"datetime\":\"2019-05-09 12:00:39\"},{\"file_name\":\"9c3e305ffdf157728f1bfda31e220a62.jpg\",\"file_type\":\"image\\/jpeg\",\"file_path\":null,\"full_path\":null,\"raw_name\":\"9c3e305ffdf157728f1bfda31e220a62\",\"orig_name\":\"1557370780134.jpg\",\"client_name\":\"1557370780134.jpg\",\"file_ext\":\".jpg\",\"file_size\":161.29,\"is_image\":true,\"image_width\":593,\"image_height\":960,\"image_type\":\"jpeg\",\"image_size_str\":\"width=\\\"593\\\" height=\\\"960\\\"\",\"default_path\":\"\\/upload\\/\",\"datetime\":\"2019-05-09 12:00:58\"}]}'),(58,1,'admin@root','root','2019-05-10 09:43:40',NULL,NULL,'게임 관련 글 올려주세요','#notice\n\n온라인, 오프라인 모두 ㅇㅇ',28,0,0,0,'play','','notice',NULL),(60,1,'admin@root','root','2019-07-08 00:24:37',NULL,NULL,'메일인증 버그 ..','Mail 태그에 disabled 걸어놔서 Sign up 버튼 누르면 Mail 값이 누락된채 전송하고 있었음..\n\n근데 메일로그 보니 메일 요청 내역은 하나도 없닼ㅋㅋㅋㅋ\n\nCSS + JS 로 수정안되게끔 수정 예정..;\n\n\n---\n\n하... 코드미러에도 에러 있네... 이건 수정 가능한건지 좀 파악해봐야할듯...\n\n5.2.0 버전 쓰니 에러는 안나는구만..\n\n---\n\nNHN 분들 도움으로 최신버전에서도 정상 동작하게끔 코드미러 고침..ㄷㄷㄷ\n\nhttps://github.com/codemirror/CodeMirror/issues/5087\n\n패키지 내려받아서 CodeMirror/src/input/TextareaInput.js 부분 수정하고 rollup 으로 합침\n\n크롬 문제여서 어차피 수정될 문제라고는 하지만,, 이렇게 수정하니 깔끔하고 기분 좋음ㅋ',90,0,0,0,'notice','','',NULL),(61,1,'admin@root','root','2019-08-21 09:19:30',NULL,NULL,'서버 이전 예정 08/21 ~ 08/31',' 이유\n \n 1. OS 버전 업\n 2. **곧 있으면 무료 프로모션이 끝나서.**',2,0,0,1,'notice','','',NULL);
